import React from 'react'

class Menu extends React.Component {
    render() {
        return(
        <nav>
            <ul>
                <li>
                    <button onClick={this.props.handleClick}>
                        Click ME
                    </button>
                </li>
            </ul>
        </nav>
        )
    }
}

export default Menu
